angular.module("messageService",[]).factory("Message",["$http",function($http){var message={};return message.all=function(){return $http.get("api/messages")},message.get=function(id){return $http.get("api/messages/"+id)},message.create=function(data){return $http.post("api/messages/",data)},message.contact=function(data){return $http.post("api/messages/contact",data)},message.update=function(id,data){return $http.put("api/messages/"+id,data)},message.flag=function(id,data){return $http.put("api/messages/flag/"+id,data)},message["delete"]=function(id){return $http["delete"]("api/messages/"+id)},message}]);